import React, {Fragment} from 'react';
import Header from "../../components/Header/Header";
import {Button} from "react-bootstrap";
import "./Verification.module.css"
import {Link} from "react-router-dom";
import {AUTHORISATION_ROUTE} from "../../utils/consts";

const Verification = () => {
    return (
        <div>
            <Header />
            <Fragment>
                <div>
                    <div className='wrapper'>
                        <div className='form-box'>
                            <h2>Введите 6-значный код из письма</h2>
                            <div className="pincode">
                                <input type="number" />
                                <input type="number"/>
                                <input type="number"/>
                                <input type="number"/>
                                <input type="number"/>
                                <input type="number"/>
                            </div>
                            <div className={"flex"}>
                                <Link to={AUTHORISATION_ROUTE}>
                                    <button className="btn" variant={"link"} active>назад</button>
                                </Link>
                                <Button variant={"success"} active>отправить</Button>
                            </div>
                        </div>
                    </div>
                </div>
            </Fragment>
        </div>
    );
};

export default Verification;
